using System.Collections.Generic;
using Microsoft.AspNetCore.Mvc;
using RecipeBackend.Models;
using RecipeBackend.Repositories;
using System.Threading.Tasks;

namespace RecipeBackend.Controllers
{
    [Route("api/[controller]")]
    public class RecipesController : Controller
    {
        private readonly IRecipeRepository _recipeRepository;

        private Recipe[] recipes = new Recipe[]
        {
            new Recipe()
            {
                Name= "Recipe 0",
                Id = "0",
                PrepTime = 30,
                CookTime = 60,
                Directions = new string[]{
                    "Prepare it",
                    "Cook it"
                },
                Servings= 2,
                Ingredients = new Ingredient[]
                {
                    new Ingredient()
                    {
                        Name = "Eggs",
                        Quantity = 3
                    },
                    new Ingredient()
                    {
                        Name = "Flour",
                        Quantity = 4,
                        Unit = "Cups",
                        Comment = "I used White Flour"

                    }
                },
                IsGlutenFree = false,
                IsKosher = true,
                IsVegan = false,
                IsVegitarian = true,
                Images = new string[]{ "data:image/jpeg;base64," }
            },
            new Recipe()
            {
                Name="Recipe 1",
                Id = "1",
                PrepTime = 15,
                CookTime = 90,
                Directions = new string[]{
                    "Step 1",
                    "Step 2",
                    "Step 3"
                },
                Servings= 50,
                Ingredients = new Ingredient[]
                {
                    new Ingredient()
                    {
                        Name = "Water",
                        Quantity = 3,
                        Unit = "Liters"
                    },
                    new Ingredient()
                    {
                        Name = "Flour",
                        Quantity = 0.25,
                        Unit = "Liters",
                        Comment = "I used whole wheat Flour"

                    },
                    new Ingredient()
                    {
                        Name = "Chicken",
                        Quantity = 3.5,
                        Unit = "kilograms"
                    }
                },
                IsGlutenFree = false,
                IsKosher = true,
                IsVegan = false,
                IsVegitarian = false,
                Images = new string[]{ "data:image/jpeg;base64," }
            }
        };

        public RecipesController(IRecipeRepository recipeRepository)
        {
            _recipeRepository = recipeRepository;
        }

        [HttpGet]
        public Task<IEnumerable<Recipe>> Get()
        {
            return _recipeRepository.GetAllRecipes();
        }

        [HttpGet("{id}")]
        public Task<Recipe> Get(string id)
        {
            return _recipeRepository.GetRecipe(id);
        }

        [HttpGet("init")]
        public Task<IEnumerable<Recipe>> Init()
        {
            _recipeRepository.AddRecipe(recipes[0]);
            _recipeRepository.AddRecipe(recipes[1]);

            return _recipeRepository.GetAllRecipes();
        }

        [HttpPost]
        public void Post([FromBody]Recipe recipe)
        {
            _recipeRepository.AddRecipe(recipe);
        }

        [HttpPut("{id}")]
        public void Put(string id, [FromBody]Recipe recipe)
        {
            _recipeRepository.UpdateRecipe(id, recipe);
        }

        [HttpDelete("{id}")]
        public void Delete(string id)
        {
            _recipeRepository.RemoveRecipe(id);
        }
    }
}
